query ContentfulBlogPostBySlug(
  $slug: String!
) {
  site {
    siteMetadata {
      title
      author
    }
  }
  contentfulPost(slug: {eq: $slug}) {
    title
    subtitle
    author
    featuredImage {
      fluid {
        ...GatsbyContentfulFluid
      }
    }
    createdAt(formatString: "MMMM DD, YYYY")
    content {
      childContentfulRichText {
        html
      }
    }
  }
}

fragment GatsbyContentfulFluid on ContentfulFluid {
  base64
  aspectRatio
  src
  srcSet
  sizes
}

